import{_ as t,b as l,e as r,a7 as e,f as a}from"./chunks/framework.Dh9YhSwE.js";const m=JSON.parse('{"title":"谱面制作","description":"","frontmatter":{"date":1769768548000,"authors":[],"tags":[],"head":[]},"headers":[],"relativePath":"chart_making/index.md","filePath":"chart_making/index.md","lastUpdated":1769768548000,"timestamp":1769768548000,"datetime":"2026-01-30T10:22:28.000Z","contributors":[{"commits":3,"email":"umaru2017@163.com","name":"ShimitsuKoi","avatar":"https://gravatar.com/avatar/7877f0fe34125dd3e1a6c4ddb14dcc6b","maintainer":false,"links":[]}]}'),o={name:"chart_making/index.md"};function n(s,i,c,d,p,h){return r(),l("div",null,[...i[0]||(i[0]=[e('<h1 id="谱面制作" tabindex="-1">谱面制作 <a class="header-anchor" href="#谱面制作" aria-label="Permalink to &quot;谱面制作&quot;">​</a></h1><p>学习如何开始创作并分享您的 未界音律UNTiTlED 谱面。</p><div class="brand custom-block"><p class="custom-block-title">BRAND</p><p>本文适用于 <strong>未界音律UNTiTlED Ver.0.9.1</strong> 以及<strong>未界音律谱面编辑器ChartEditorOfUNTiTlED Ver0.3.1</strong> 及以上版本。</p></div><h2 id="下载并运行制谱器以获取-uuid" tabindex="-1">下载并运行制谱器以获取 UUID <a class="header-anchor" href="#下载并运行制谱器以获取-uuid" aria-label="Permalink to &quot;下载并运行制谱器以获取 UUID&quot;">​</a></h2><p>您可以从<a href="https://wwaso.lanzouu.com/iBLHy3gu76ha" target="_blank" rel="noreferrer">这里</a>下载 未界音律UNTiTlED 制谱器。</p><p>将压缩文件解压至任意位置之后，双击 ChartEditorOfUNTiTlED.exe 运行制谱器。</p><p>在“设置”页面的“授权”栏目中，点击 “UUID” 项右侧的“拷贝”按钮来复制 UUID 。</p><h2 id="注册一个-untitled-账户" tabindex="-1">注册一个 UNTiTlED 账户 <a class="header-anchor" href="#注册一个-untitled-账户" aria-label="Permalink to &quot;注册一个 UNTiTlED 账户&quot;">​</a></h2><p>您需要一个 UNTiTlED 账户来上传谱面，请参阅“<a href="/wiki/guide/#注册账号">注册UNTiTlED账户</a>”</p><h2 id="审核" tabindex="-1">审核 <a class="header-anchor" href="#审核" aria-label="Permalink to &quot;审核&quot;">​</a></h2><p>首先，您需要通过审核。</p><p><strong>您必须符合以下条件之一：</strong></p><ul><li>Arcaea ptt 12.00以上</li><li>范式：起源任意一张15+级以上谱面一百万分以上</li><li>Polytone任意一张12级以上谱面精确度98%以上</li><li>有任意音乐游戏制谱经验，发送您觉得最好的谱面</li></ul><p>通过下面的渠道将您的<strong>验证信息，UNTiTlED账户名称和 UUID</strong> 一并发给我们：</p><ul><li><a href="https://qun.qq.com/universal-share/share?ac=1&amp;authKey=5Hunj98%2BH0bgeQEynCclC8EuEbZQPomQ%2B4DR5GLJVod4JCWUlXGUFdpF4F0%2BxKt9&amp;busi_data=eyJncm91cENvZGUiOiI2ODc2Nzk3MDgiLCJ0b2tlbiI6ImFmd2ZYOFlSWFRUc0N0S0hpd0JBSTlzWDZpS1MwSFhXQnpvUTNoYjFqRGZXQUo0eUtnRHJjVnNnOExSMFVaakUiLCJ1aW4iOiIxMTA0NTI4MDgxIn0%3D&amp;data=n3tfg9nhZtkP4qa7gpvqDMgiRnVIf1KCw3aYM9p8o2HD1DfQR-xJqXlHJ-jn7j5OXNQbwP0Bx1ugkC7hJP69Vg&amp;svctype=4&amp;tempid=h5_group_info" target="_blank" rel="noreferrer">加入官方QQ群</a></li><li>【<a href="mailto:UMARU_feedback@163.com" target="_blank" rel="noreferrer">UMARU_feedback@163.com</a>】</li></ul><h2 id="使用制谱器制作谱面" tabindex="-1">使用制谱器制作谱面 <a class="header-anchor" href="#使用制谱器制作谱面" aria-label="Permalink to &quot;使用制谱器制作谱面&quot;">​</a></h2><p>当您通过后，您将会收到回复，其包含一串只能在此设备上使用的授权码。恭喜，您已成功获得 未界音律UNTiTlED 制谱资格，关于制谱器的详细使用，请参阅“<a href="/wiki/building.html">制谱器</a>“。</p>',17),a("div",{class:"thumbnail custom-block"},[a("iframe",{src:"//player.bilibili.com/player.html?isOutside=true&aid=112963360919042&bvid=BV14Gexe8E33&cid=500001649848044&p=1",scrolling:"no",border:"0",frameborder:"no",framespacing:"0",allowfullscreen:"true"}),a("div",{class:"caption custom-block"},[a("p",null,"未界音律UNTiTlED制谱器V0.1.0使用教程")])],-1),e('<h2 id="上传您的谱面" tabindex="-1">上传您的谱面 <a class="header-anchor" href="#上传您的谱面" aria-label="Permalink to &quot;上传您的谱面&quot;">​</a></h2><p>当您完成谱面制作后，如果您想要将谱面上传到 UNTiTlED Community 并向所有 UNTiTlED 玩家分享您的谱面，请按照以下步骤：</p><h3 id="一、确认-untitled-community-存在您的谱面使用的歌曲的记录" tabindex="-1">一、确认 UNTiTlED Community 存在您的谱面使用的歌曲的记录 <a class="header-anchor" href="#一、确认-untitled-community-存在您的谱面使用的歌曲的记录" aria-label="Permalink to &quot;一、确认 UNTiTlED Community 存在您的谱面使用的歌曲的记录&quot;">​</a></h3><ol><li>输入歌曲的标题或者艺术家；</li><li>单击“获取已记录的音乐”；</li><li>在下面的视图中单击您的谱面对应使用的音乐；</li></ol><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>这将会<strong>直接覆盖</strong>您在“谱面信息”中输入的“标题”和“艺术家”信息，请确保选择的音乐信息与您在“谱面信息”中输入的完全一致。</p></div><ol start="4"><li>检查“谱面信息”中“歌曲ID”一栏，确保其值不为0。</li></ol><h4 id="如果找不到对应的音乐信息" tabindex="-1">如果找不到对应的音乐信息 <a class="header-anchor" href="#如果找不到对应的音乐信息" aria-label="Permalink to &quot;如果找不到对应的音乐信息&quot;">​</a></h4><p>请通过<a href="#审核">上面的联系方式</a>联系我们添加。</p><h3 id="二、确保谱面内容完整" tabindex="-1">二、确保谱面内容完整 <a class="header-anchor" href="#二、确保谱面内容完整" aria-label="Permalink to &quot;二、确保谱面内容完整&quot;">​</a></h3><p>一个完整的UBM谱面通常包含以下内容：</p><ul><li>一个json谱面文件</li><li>一个mp3音频文件</li><li>一个jpg图片文件 （可选）</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>jpg图片文件 作为封面，通常是可选的，但我们强烈推荐您添加。</p></div><p>请确保在 制谱器 -&gt; 设置 -&gt; 设置路径 中选择了正确的文件。</p><h3 id="三、上传谱面" tabindex="-1">三、上传谱面 <a class="header-anchor" href="#三、上传谱面" aria-label="Permalink to &quot;三、上传谱面&quot;">​</a></h3><p>单击“导出并上传UBM谱面文件”即可将导出的UBM文件上传到 UNTiTlED Community。</p><div class="success custom-block"><p class="custom-block-title">SUCCESS</p><p>在下方您可以看到上传状态，success则表明上传成功。</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>为了避免恶意上传，谱面上传频率受到限制，每个拥有上传权限的谱师 仅能上传<strong>1次/每小时</strong>和<strong>3次/每天</strong>。若要通过游玩检查未完成的谱面，请参阅<a href="/wiki/building.html">手动导入UBM谱面文件</a>。</p></div><h3 id="四、将您的谱面设为待审核-pending-状态" tabindex="-1">四、将您的谱面设为待审核（Pending）状态 <a class="header-anchor" href="#四、将您的谱面设为待审核-pending-状态" aria-label="Permalink to &quot;四、将您的谱面设为待审核（Pending）状态&quot;">​</a></h3><p>上传成功后，您的谱面即刻开放下载，但由于状态在等待中（WIP），无法使用<strong>排行榜</strong>等功能（详细参阅“<a href="/wiki/building.html">社区谱面的状态</a>”）。</p><p>请进入 UNTiTlED 游戏本体 -&gt; Online Missions -&gt; My Missions ，找到您想要进行审核的谱面，单击右侧的时钟图标，此时谱面进入 Pending 状态</p><h3 id="五、等待" tabindex="-1">五、等待 <a class="header-anchor" href="#五、等待" aria-label="Permalink to &quot;五、等待&quot;">​</a></h3><p>恭喜，您的谱面已成功进入待审核（Pending）阶段，请耐心等待，如果您的谱面拥有较高质量，便会变为已审核（Qualified），便可使用排行榜等功能</p>',22)])])}const b=t(o,[["render",n]]);export{m as __pageData,b as default};
